[[package]]
name = "amazon-textract-prettyprinter"
version = "0.0.10"
description = "Amazon Textract Helper tools for pretty printing"
category = "main"
optional = false
python-versions = ">=3.6"

[package.dependencies]
amazon-textract-response-parser = ">=0.1.5"
boto3 = "*"
botocore = "*"
tabulate = "0.8.9"

[[package]]
name = "amazon-textract-response-parser"
version = "0.1.23"
description = "Easily parse JSON returned by Amazon Textract."
